import { RadialChart } from "react-vis";

const Chart = () => {
    return (
        <RadialChart
        getLabel={d => d.label}
        data={[
          { angle: 1, color: "#8DB9F2", name: "blue", opacity: 0.2 },
          { angle: 2, color: "#f2e852", name: "yellow" },
          { angle: 5, color: "#3b9668", name: "cyan" },
          { angle: 3, color: "#DA70BF", name: "magenta" },
          { angle: 5, color: "#F6D18A", name: "yellow again" }
        ]}
        labelsRadiusMultiplier={1.6}
        labelsStyle={{ fontSize: 16, fill: "#222" }}
        width={350}
        height={300}
      />
    )
}

export default Chart
